import logo from './logo.svg';
import { useRef, useState } from 'react';
import './Expense.css';
import AvailabeExpenses from './AvailabeExpenses'
import ExpenseItem from './ExpenseItem'

import classes from './Checkout.module.css';

const isEmpty = (value) => value.trim() === '';


const Checkout = (props) => {
  const [formInputsValidity, setFormInputsValidity] = useState({
    Month: true,
    Year: true,
    Day: true,
    Description: true,
  });


  const monthInputRef = useRef();
  const yearInputRef = useRef();
  const dayInputRef = useRef();
  const descriptionInputRef = useRef();

  const confirmHandler = (event) => {
    event.preventDefault();

    const enteredMonth = monthInputRef.current.value;
    const enteredYear = yearInputRef.current.value;
    const enteredDay = dayInputRef.current.value;
    const enteredDescription = descriptionInputRef.current.value;

    const enteredMonthIsValid = !isEmpty(enteredMonth);
    const enteredYearIsValid = !isEmpty(enteredYear);
    const enteredDayIsValid = !isEmpty(enteredDay);
    const enteredDescriptionIsValid = !isEmpty(enteredDescription);

    setFormInputsValidity({
      Month: enteredMonthIsValid,
      Year: enteredYearIsValid,
      Day: enteredDayIsValid,
      Description: enteredDescriptionIsValid,
    });

    const formIsValid =
      enteredMonthIsValid &&
      enteredYearIsValid &&
      enteredDayIsValid &&
      enteredDescriptionIsValid;

    if (!formIsValid) {
      return;
    }

    props.onConfirm({
      Month: enteredMonth,
      Year: enteredYear,
      Day: enteredDay,
      Description: enteredDescription,
    });
  };
};


function App() {

  return (
    <div className="desktop1-container">
      <div className="desktop1-desktop1">
        <span className="desktop1-text">Expenses</span>
        <input className="desktop1-rectangle1" type="text" placeholder="Description"/>
        <select className="desktop1-rectangle2" placeholder="Month">
           <option value="" disabled="" selected="">Month</option>
           <option value="January">January</option>
           <option value="Feburuary">Feburuary</option>
           <option value="March">March</option>
           <option value="April">April</option>
           <option value="May">May</option>
           <option value="June">June</option>
           <option value="July">July</option>
           <option value="August">August</option>
           <option value="September">September</option>
           <option value="October">October</option>
           <option value="November">November</option>
           <option value="December">December</option>
        </select>
        <input className="desktop1-rectangle3" placeholder="Day" type="number"  min="1" max="31"></input>
        <input className="desktop1-rectangle5" placeholder="Amount" type="number"  min="1" ></input>
        <button className="desktop1-svg"> Add </button>
        <select className="desktop1-rectangle6" placeholder="Month">
           <option value="" disabled="" selected="">Month</option>
           <option value="January">January</option>
           <option value="Feburuary">Feburuary</option>
           <option value="March">March</option>
           <option value="April">April</option>
           <option value="May">May</option>
           <option value="June">June</option>
           <option value="July">July</option>
           <option value="August">August</option>
           <option value="September">September</option>
           <option value="October">October</option>
           <option value="November">November</option>
           <option value="December">December</option>
        </select>
        <input className="desktop1-rectangle7" placeholder="Year" type="number"></input>
        <input className="desktop1-rectangle4"placeholder="Year" type="number"></input>


        <button className="desktop1-svg1">Search</button>
        <div className = "desktop1-svg2"></div>
        <span className="desktop1-text1">Search Expenses</span>
        <div className='list-container'>
          <AvailabeExpenses/>
        </div>
      </div>
    </div>
  );
}



